INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "お！\nあそこに困ってそうな人発見！", 1, 1, 1.4, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "春咲 ひより", 2, 0, 1, 0, 1001);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "大切な人を\n守れるようになりたい…って", 1, 1, 1.4, "わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ", "草野 優衣", 2, 0, 1, 0, 1002);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "キミに必要な集中力と感性が", 1, 1, 1.4, "少しは磨かれると思いますよ。", "フェンシングを始めてみては？", "士条 怜", 2, 0, 1, 0, 1003);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "今日はなにして遊ぶ？", 1, 1, 1.5, "みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！", "穂高 みそぎ", 2, 0, 1, 0, 1004);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "ねぇ…", 1, 1, 1.4, "私といっしょに…\nいかない？", "風宮あかりです", "風宮 あかり", 2, 0, 1, 0, 1006);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "プリンたべたいのー", 1, 1, 1.5, "食べ物の恨みは怖いのー", "出雲宮子なのー", "出雲 宮子", 2, 0, 1, 0, 1007);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 1, 1.4, "いいよ。\n見られることは運命さ…", "ボクは虹村雪。", "虹村 雪", 2, 0, 1, 0, 1008);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 1, 1.4, "人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！", "柊杏奈", 2, 0, 1, 0, 1009);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 1, 1.5, "ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす", "姫宮 真歩", 2, 0, 1, 0, 1010);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 1, 1.4, "ここで会ったが\n100年目～！", "衣之咲璃乃です！", "衣之咲 璃乃", 2, 0, 1, 0, 1011);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "ち、超能力って…\n何のことかな～？", 1, 1, 1.4, "…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆", "柏崎 初音", 2, 0, 1, 0, 1012);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "一応カリスマ読モJKやってまっす！", 1, 1, 1.4, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪", "美波 鈴奈", 2, 0, 1, 0, 1016);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "東京は遊園地みたいなところさー", 1, 1, 1.4, "でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。", "喜屋武 香織", 2, 0, 1, 0, 1017);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "先生って呼ばれるのは\nくすぐったいから", 1, 1, 1.4, "イオちゃんって呼んでね。", "支倉伊緒です。", "支倉 伊緒", 2, 0, 1, 0, 1018);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 1, 1.5, "ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "茜 ミミ", 2, 0, 1, 0, 1020);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "あの……\nふぇ……", 1, 1, 1.5, "ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……", "栗林 くるみ", 2, 0, 1, 0, 1021);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "こんな私に貴重な時間を\n割いていただき、", 1, 1, 1.4, "なんてありがとうございます！", "風宮よりです。\nあああああ！", "風宮 より", 2, 0, 1, 0, 1022);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "おにいちゃんどこいくの？\nえ？", 1, 1, 1.5, "私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "北条 綾音", 2, 0, 1, 0, 1023);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 1, 1.4, "これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！", "天野 すずめ", 2, 0, 1, 0, 1025);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "あなたは…運命の……\n伴侶……", 1, 1, 1.4, "離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……", "倉石 恵理子", 2, 0, 1, 0, 1027);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 1, 1.4, "…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "佐々木 咲恋", 2, 0, 1, 0, 1028);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, 1, 1.4, "あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ", "桜井 望", 2, 0, 1, 0, 1029);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 1, 1.4, "ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！", "ニノン・ジュベール", 2, 0, 1, 0, 1030);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, 1, 1.4, "おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。", "上喜 しのぶ", 2, 0, 1, 0, 1031);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "けんども\nそれには足りないモンが…", 1, 1, 1.5, "そう、\nオラのボケに突っ込める相方が…！", "目指すはビッグな\nお笑い芸人だっぺ！", "野戸まひる", 2, 0, 1, 0, 1033);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "ちょっと緊張しちゃって…", 1, 1, 1.4, "ちょ\nちょっと一杯飲んできます…！", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "綾瀬 ゆかり", 2, 0, 1, 0, 1034);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "知らない人とは話しちゃいけないので", 1, 1, 1.5, "これ以上お話しすることは…\nないです！", "氷川鏡華…です", "氷川 鏡華", 2, 0, 1, 0, 1036);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "……あ、アラーム。", 1, 1, 1.4, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎…栞です。", "柏崎 栞", 2, 0, 1, 0, 1038);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "私、一人も友達がいなくて……", 1, 1, 1.4, "野に咲く花が、\n唯一の話相手です。", "ふ、双葉碧です。", "双葉 碧", 2, 0, 1, 0, 1040);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 1, 1.4, "そう思っています。", "三角千歌です。", "三角 千歌", 2, 0, 1, 0, 1042);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "あぁ？\nお前のそいつの仲間か？", 1, 1, 1.4, "う、疑ってすまなかったな…", "安芸真琴だ。", "安芸 真琴", 2, 0, 1, 0, 1043);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "生けとし生ける全ての者よ！", 1, 1, 1.4, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "わらわこそは夜を総べる者！", "イリヤ・オーンスタイン", 2, 0, 1, 0, 1044);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "ぐふふふふ……はっ！", 1, 1, 1.4, "ｌク、クウカに何かご用ですか!?", "そこで騎士は妖精を乱暴に……", "遠見 空花", 2, 0, 1, 0, 1045);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 1, 1.4, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまきにゃ♪\n猫はいいにゃよ？", "宮坂たまき", 2, 0, 1, 0, 1046);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "それでは早速クエストに…", 1, 1, 1.4, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神美冬よ！", "大神 美冬", 2, 0, 1, 0, 1048);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "クエストもバトルも\n掃除も洗濯も", 1, 1, 1.4, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流だよ！", "星野静流", 2, 0, 1, 0, 1049);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "見ての通りの\nセクシー美少女で", 1, 1, 1.5, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "アタシは玉泉美咲。", "玉泉美咲", 2, 0, 1, 0, 1050);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "？？？？", 1, 1, 1.4, "？？？？", "？？？", "リマ", 2, 0, 1, 0, 1052);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 1, 1.5, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", "モニカ・ヴァイスヴィント", 2, 0, 1, 0, 1053);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 1, 1.5, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", "ペコリーヌ", 2, 0, 1, 0, 1058);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 1, 1.5, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", "コッコロ", 2, 0, 1, 0, 1059);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 1, 1.5, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", "キャル", 2, 0, 1, 0, 1060);
